                                    </a>
                                    <a href="/chat">
                                        <button type="button"
                                            class="text-white border-2 border-green-400 hover:bg-gradient-to-br focus:ring-4 focus:outline-none focus:ring-green-300 font-medium rounded-full text-sm px-10 py-2.5 text-center mr-2 mb-2">
                                            ChatBot
